import UIKit

func isIsomorphic(_ s: String, _ t: String) -> Bool {
    var hashMapS = [Character : Character]()
    var hashMapT = [Character : Character]()
    for index in s.indices {
        var charTwo = t[index]
        if hashMapS[s[index]] != nil && hashMapS[s[index]] !=  charTwo {
            return false
        }
        if hashMapT[charTwo] != nil && hashMapT[charTwo] !=  s[index] {
            return false
        }
        hashMapS[s[index]] = charTwo
        hashMapT[charTwo] = s[index]
    }
    return true
}

